import http from "../http-common";

class JogadorasDataService {

  getAll() {
    return http.get("/jogadoras");
	}

	findByFilter(posicao) {
    return http.get(`/jogadoras?posicao=${posicao}`);
  }
}

export default new JogadorasDataService();
